import React from 'react';


const Paginacion = props => {
    return (
        <div className="py-3">
            
            {' '}<button onClick={props.paginaAnterior} type="button "  className="btn btn-info mr-1">Anterior &larr;</button>{' '}
            {' '}<button position="btn btn-right" onClick={props.paginaSiguiente} type="button " className="btn btn-info ">Siguiente &rarr;</button>{' '}
        </div>
    )
}
export default Paginacion;
